const PROXY_URL = "https://proxy-q-doctor.herokuapp.com/api/emias/"
const SCHEDULE_URL = "schedule"


function getSchedule(omsNumber, birthDate) {
  return fetch(
    PROXY_URL+SCHEDULE_URL+`?oms_number=${omsNumber}&birth_date=${birthDate}`,
    {
      method: 'GET',
      headers: {'Content-Type': 'application/json'},
    },
  );
};


export const loadSchedule = (omsNumber, birthDate) => {
  console.log('test_redux-action-schedule', omsNumber, birthDate)
	return function(dispatch) {
    dispatch(loadScheduleAction);
    return getSchedule(omsNumber, birthDate)
            .then(response => {
              if (response.status !== 200) {throw 'Ошибка авторизации'};
              return response
            })
            .then(response => response.json())
            .then(response => dispatch(loadScheduleSuccess(response)))
            .catch(error => dispatch(loadOperationsFailureAction));
	};
};

export const loadScheduleAction = {
	type: 'LOAD_SCHEDULE',
	payload: null,
};

export const loadScheduleFailureAction = {
	type: 'LOAD_SCHEDULE_FAILURE',
	payload: null,
};

export const loadScheduleSuccess = payload => ({
	type: 'LOAD_SCHEDULE_SUCCESS',
	payload: payload,
});
